CREATE EXTENSION IF NOT EXISTS "postgis";

-- create and populate cities and states tables
-- adapted from https://github.com/kelvins/US-Cities-Database

CREATE TABLE IF NOT EXISTS us_states (
  code TEXT(2) UNIQUE NOT NULL PRIMARY KEY,
	"name" TEXT NOT NULL
);

