CREATE TABLE IF NOT EXISTS us_cities (
	id UUID NOT NULL PRIMARY KEY DEFAULT gen_random_uuid(),
  state_code TEXT(2) NOT NULL REFERENCES us_states(code),
	"name" TEXT NOT NULL,
	county TEXT,
	latitude NOT NULL,
	longitude double NOT NULL
);

